import React, { Component } from 'react';

class invoicecreatetable extends Component {
    render() {
        return (
            <div>
                <table className="table table-bordered" id='datas'>
                    <thead>
                        <tr>
                            <th>Item Details</th>
                            <th>Quantity</th>
                            <th>Price</th>
                            <th>Tax</th>
                            <th>Amount</th>
                        </tr>
                    </thead>
                    <tbody>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default invoicecreatetable;
